        line2: 'Middleton Farmln',
        city: 'herndon',
    },
    profiles : ['twitter', 'meta', 'linkedin'],
    // function
    printProfile: () => {
        console.log(person.profiles[0])
    }
}

export default function LearningJavascript(){
    return (
        <>
        <div>{person.name}</div>
        <div>{person.address.city}</div>
        <div>{person.profiles[0]}</div>
        </>
    )
}
